struct Map<V> {
    private_context: Option<&mut PrivateContext>,
    public_context: Option<&mut PublicContext>,
    storage_slot: Field,
    state_var_constructor: fn(Option<&mut PrivateContext>, Option<&mut PublicContext>, Field) -> V,
